import pandas as pdimport numpy as npfrom sklearn.model_selection import train_test_splitfrom sklearn.preprocessing import StandardScalerfrom sklearn.svm import SVRfrom sklearn import metricscolumns = ['Frequency', 'Angle of Attack', 'Chord Length', 'Velocity', 'Displacement', 'Sound Pressure']data = pd.read_csv('airfoil_self_noise.dat', sep='\t', names=columns)x = data.drop('Sound Pressure', axis=1)y = data['Sound Pressure']train_x, test_x, train_y, test_y = train_test_split(x, y, test_size=0.3, random_state=101)sc_x = StandardScaler()train_x = sc_x.fit_transform(train_x)test_x = sc_x.fit_transform(test_x)# sc_y = StandardScaler()# train_y = sc_y.fit_transform(np.array([train_y]))# test_y = sc_y.fit(np.array([test_y]))# print(test_y)regressor = SVR()regressor.fit(train_x, train_y)predictor = regressor.predict(test_x)predictor_df = pd.DataFrame(predictor)eval = pd.DataFrame({'test':test_y, 'predict': predictor})mae = metrics.mean_absolute_error(test_y, predictor)mse = metrics.mean_squared_error(test_y, predictor)rmse = np.sqrt(mse)print('######### Support Vector Regression Evaluation ###############')print('Support Vector Regression MAE: ', mae)print('Support Vector Regression MSE: ', mse)print('Support Vector Regression RMSE: ', rmse)print(eval.head(50))